(function() {


    'use strict';

    angular.module('pepawebApp').controller('calendarioCtrl', calendarioCtrl);

    calendarioCtrl.$inject = ['Calendario', '$q', 'ambienteFormacionServices', 'FichasService', 'usuariosService', '$filter'];

    function calendarioCtrl(Calendario, $q, ambienteFormacionServices, FichasService, usuariosService, $filter) {

        var vm = this;
        vm.renderView = renderView;
        //vm.changeView = changeView;
        vm.selectedFichaChange = selectedFichaChange;
        vm.selectedAmbienteChange = selectedAmbienteChange;
        vm.selectedInstructorChange = selectedInstructorChange;

        activate();

        function activate() {
            vm.events = [];
            var promises = [];
            return $q.all(promises).then(function() { });
        }

        function getDetallesSabana() {
            vm.eventSources = [];
            var datosCalendario;

            if (vm.ficha != null && vm.ambienteFormacion == null && vm.usuario == null) {

                Calendario.searchByFicha({
                    fechaInicial: $filter('date')(vm.startDate, 'yyyy-MM-dd', '-0500'),
                    fechaFinal: $filter('date')(vm.endDate, 'yyyy-MM-dd', '-0500'),
                    idFicha: vm.ficha.idFicha
                }).$promise.then(
                    function(data) {
                        datosCalendario = $filter('filter')(data);
                        if (datosCalendario != null && datosCalendario != undefined) {
                            addEvent(datosCalendario);
                        }
                    }).catch(function(error) {

                    });

            }

            if (vm.ficha == null && vm.ambienteFormacion != null && vm.usuario == null) {
                Calendario.searchByAmbiente({
                    fechaInicial: $filter('date')(vm.startDate, 'yyyy-MM-dd', '-0500'),
                    fechaFinal: $filter('date')(vm.endDate, 'yyyy-MM-dd', '-0500'),
                    idAmbiente: vm.ambienteFormacion.idAmbienteFormacion
                }).$promise.then(
                    function(data) {

                        datosCalendario = $filter('filter')(data);
                        if (datosCalendario != null && datosCalendario != undefined) {

                            addEvent(datosCalendario);
                        }
                    }).catch(function(error) {

                    });
            }

            if (vm.ficha == null && vm.ambienteFormacion == null && vm.usuario != null) {
                Calendario.searchByInstructor({
                    fechaInicial: $filter('date')(vm.startDate, 'yyyy-MM-dd', '-0500'),
                    fechaFinal: $filter('date')(vm.endDate, 'yyyy-MM-dd', '-0500'),
                    idInstructor: vm.usuario.idUsuario
                }).$promise.then(
                    function(data) {

                        datosCalendario = $filter('filter')(data);
                        if (datosCalendario != null && datosCalendario != undefined) {

                            addEvent(datosCalendario);
                        }
                    }).catch(function(error) {

                    });
            }
        }

        //with this you can handle the events that generated by each page render process
        function renderView(view) {
            vm.startDate = new Date(view.start);
            vm.endDate = new Date(view.end);
            getDetallesSabana();
        };


        //with this you can handle the events that generated when we change the view i.e. Month, Week and Day
        /*function changeView(view, calendar) {
          currentView = view;
          calendar.fullCalendar('changeView', view);
          vm.startDate = view.start;
          vm.endDate = view.end;
          getDetallesSabana();
          console.log('You are looking at ' + currentView);
        };*/

        vm.uiConfig = {
            calendar: {
                editable: false,
                timeFormat: 'H(:mm)',
                monthNames: ['Enero', 'Febrero', 'Marzo', 'Abril', 'Mayo', 'Junio', 'Julio', 'Agosto', 'Septiembre', 'Octubre', 'Noviembre', 'Diciembre'],
                monthNamesShort: ['Ene', 'Feb', 'Mar', 'Abr', 'May', 'Jun', 'Jul', 'Ago', 'Sep', 'Oct', 'Nov', 'Dic'],
                dayNames: ['Domingo', 'Lunes', 'Martes', 'Miércoles', 'Jueves', 'Viernes', 'Sábado'],
                dayNamesShort: ['Dom', 'Lun', 'Mar', 'Mié', 'Jue', 'Vie', 'Sáb'],
                header: {
                    left: 'prev,next today myCustomButton',
                    center: 'title',
                    right: 'month,agendaWeek,agendaDay'
                },
                viewRender: vm.renderView
            }
        }

        function selectedFichaChange(item) {
            getDetallesSabana();
        }

        function selectedAmbienteChange(item) {
            getDetallesSabana();
        }

        function selectedInstructorChange(item) {
            getDetallesSabana();
        }

        //Busqueda por Codigo ficha
        vm.queryCodigoFicha = function(ficha) {
            return FichasService.searchFichasByCodigo({
                codigoFicha: ficha
            });
        }

        //Busqueda Por Nombre Ambiente Formación
        vm.queryNombreFormacion = function(nombreAmbienteFormacion) {
            return ambienteFormacionServices.searchNombreAmbiente({
                nombreAmbienteFormacion: nombreAmbienteFormacion
            });
        }

        //Busqueda Por Usuarios
        vm.queryNombreInstructor = function(data) {
            return usuariosService.searchByUsuariosMultiply({
                data: data
            });
        }

        function addEvent(datosCalendario) {
            if (datosCalendario.length > 0) {
                for (var i = 0; i < datosCalendario.length; i++) {
                    vm.events[i] = datosCalendario[i];
                }
            }
        }

        function separar(datos){
          var array = datos.split(' ');
          return array;
        }

        vm.openPdf = function() {




          var vector=new Array();
          vector[0]=[{text: 'Fecha Inicial', style: 'header'}, {text: 'Fecha Final', style: 'header'},
            {text: 'Instructor', style: 'header'},{text: 'Ambiente', style: 'header'},{text: 'Ficha', style: 'header'}
          ];
          var longitud=vm.events.length;
          for (var i = 1; i < longitud; i++) {
            var datos=separar(vm.events[i].title);
            vector[i]=[$filter('date')(vm.events[i].start,'yyyy-MM-dd hh:mm:ss '),$filter('date')(vm.events[i].end,"yyyy-MM-dd HH:mm:ss"),datos[1],datos[3],datos[0]];
          }



          var docDefinition = {
        
        content: [

          {

                 image: 'data:image/jpeg;base64,',
                 fit: [100, 100],
                 width: 150,
                 height: 150,
                 marginLeft: 209,
                 marginBottom: 20
            },
          {
            text: 'Centro de Biotecnologia Industrial SENA - Palmira',
            marginBottom: 20,
            alignment: 'center'

          },
          {
            style: 'demoTable',
            table: {
              widths: ['*','*', '*', '*', '*', '*'],
              body: vector
            }
          }
        ],
        styles: {

          header: {
            alignment: 'center',
            bold: true,
            color: '#000',
            fontSize: 11
          },
          demoTable: {
            marginLeft: 70,           
            color: '#666',
            fontSize: 10
          }
        }
      };
    pdfMake.createPdf(docDefinition).open();
  }

        /* event sources array*/
        vm.eventSources = [vm.events];
    }

})();
